body:
1. Run the following code in a Microsoft Edge console on a google image search:
```
var script = document.createElement('script');
script.src = "https://ajax.googleapis.com/ajax/libs/jquery/2.2.0/jquery.min.js";
document.getElementsByTagName('head')[0].appendChild(script);
 
// grab the URLs
var urls = $('.rg_di .rg_meta').map(function() { return JSON.parse($(this).text()).ou; });
 
// write the URls to file (one per line)
var textToSave = urls.toArray().join('\n');
console.log(textToSave);
```
2. Copy the URL list from the console into a text file.

3. Run the following via command line in the directory of the new text file:
`wget -i newTextFile.txt`
